#!/bin/shell

echo $PATH;

echo ${pwd};

echo "${ls ${pwd}}";

echo "123${pwd}xyz";

sleep 1;

echo test;

sleep 1;

mkdir -s ttt;

cd ttt;

touch -s a;
touch -s b;

echo "done!!!";

